import React from "react";
import ReactDom from "react-dom";
import "./index.css"


ReactDom.render(<h1> Hellow Deepak Kumar </h1>,document.getElementById('root'));

ReactDom.render(<h2>Hellow Javascript </h2>,document.getElementById('root'));

ReactDom.render(<h3> Hellow Reactjs </h3>,document.getElementById('root'));

ReactDom.render(<h4>Hellow Nodejs </h4>,document.getElementById('root'));

ReactDom.render(<h5>Hellow Tech Gun You Are Amazing techer </h5>,document.getElementById('root'));
